import React from 'react';
import logo from '../Header/logo.png';
import { Map, GoogleApiWrapper, Marker } from 'google-maps-react';

const mapStyles = {
	width: '25%',
	height: '25%',
	left: '38%',
  };

class Booking extends React.Component {

	render(){
		return (
			<div className="App">
				<img src={logo} alt="movieposter"/>
				<div className="booking-details">
					<h5>{this.props.movieName}</h5>
					<h6>{this.props.date}</h6>
					<h6>{this.props.time}</h6>
					<h6>{this.props.seat}</h6>
					<h6>{this.props.theatreName}</h6>
					<h6>{this.props.location}</h6>
					<h6>{this.props.transactionId}</h6>
				</div>
				<div className="map">
					<Map
          				google={this.props.google}
          				zoom={8}
          				style={mapStyles}
          				initialCenter={{ lat: 47.444, lng: -122.176}}/>
						<Marker position={{ lat: 48.00, lng: -122.00}} />
				</div>
      		</div>
     	);
 	}

}

export default GoogleApiWrapper({
	apiKey: 'AIzaSyCHHazDxomKFsTi-j_BS_4DC7umHdPX0dU'
})(Booking);
